import React from "react";

const Pagination = ({ setPageNumer }) => {
  const prev = () => {
    setPageNumer((page) => page + 1);
  };
  const next = () => {};

  return (
    <div>
      <button onClick={prev}>Prev</button>
      <button onClick={next}>Next</button>
    </div>
  );
};

export default Pagination;
